extras.func:
var chstr = msg.message.Subject;
msg.check = chstr.includes("#ROBO#");
var dict = {};
if (msg.check === true) {
  chstr = chstr.replace("#ROBO#","");
  var splittedsub = chstr.split(",");
  splittedsub.forEach(splitstr);

}
function splitstr(item){
  item = item.trim();
  item = item.replace(" ", "");
  var x = item.split("=");
  key = x[0];
  value = x[1];
  dict[key] = value;
}
msg.job = dict['JOB'];
msg.info = dict['INFO'];
msg.stat = dict['STATUS'];
msg.mailId = msg.message.Uid;
return msg;

